function SliderBtn() {
    return (
        <button type="button" class="btn btn-primary yellow-btn btn-floating "
            style="font-size: 1.5rem; border-radius: 8px !important;" id="btn-back-to-top">
            <i class="bi bi-arrow-up-circle-fill"></i>
        </button>
    );
}
export default SliderBtn
